export const AUTH_CHANGE_LOGIN = 'AUTH_CHANGE_LOGIN';
export const AUTH_CHANGE_SESSION = 'AUTH_CHANGE_SESSION';

export const setLogin = (login) => ({
    type: AUTH_CHANGE_LOGIN,
    payload: login
});

export const setSession = (session) => ({
    type: AUTH_CHANGE_LOGIN,
    payload: session
})
